import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navigation from './components/Navigation';
import HomePage from './pages/HomePage';
import AboutUs from './pages/AboutUs';
import IntakeForms from './pages/IntakeForms';
import CommunityOutreachAndEducationIntakeForm from './pages/CommunityOutreachAndEducationIntake-RegistrationForm';
import ThriveInternationalIntakeForm from './pages/ThriveInternationalIntake-RegistrationForm';

const App: React.FC = () => {
  return (
    <Router>
      <div className="font-sans bg-gray-50 min-h-screen">
        {/* Navigation Bar */}
        <Navigation />

        {/* Page Routes */}
        <Routes>
          <Route path="/" element={<HomePage />} />
          <Route path="/about" element={<AboutUs />} />
          <Route path="/intake" element={<IntakeForms />} />
          <Route
            path="/intake/community-outreach"
            element={<CommunityOutreachAndEducationIntakeForm />}
          />
          <Route
            path="/intake/thrive-international"
            element={<ThriveInternationalIntakeForm />}
          />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
